import React, { Component } from "react";
import {
  StyleSheet,
  View,
  StatusBar,
  Text,
  TouchableOpacity,
  ScrollView,
} from "react-native";
import Session from "./components/Session";
import EntypoIcon from "react-native-vector-icons/Entypo";
import FeatherIcon from "react-native-vector-icons/Feather";

function Feed(props) {
  return (
    <View style={styles.container}>
      <StatusBar hidden />
      <View style={styles.icon1Row}>
        <EntypoIcon name="shop" style={styles.icon1}></EntypoIcon>
        <Text style={styles.buyCoupons}>Buy Coupons</Text>

        <View style={styles.group}>
          <TouchableOpacity style={styles.button}>
            <FeatherIcon name="user" style={styles.icon2}></FeatherIcon>
          </TouchableOpacity>
        </View>
      </View>

      <Text style={styles.sessions}>Sessions</Text>
      <Text style={styles.joinAGame}>Join a game!</Text>
      <ScrollView style={styles.scrollview}>
        <Session style={styles.session}></Session>
        <Session style={styles.session}></Session>
        <Session style={styles.session}></Session>
        <Session style={styles.session}></Session>
        <Session style={styles.session}></Session>
        <Session style={styles.session}></Session>
      </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "rgba(227,214,214,1)",
  },
  scrollview: {
    alignSelf: "center",
  },
  session: {
    height: 200,
    width: 350,
    marginTop: 20,
  },
  sessions: {
    fontFamily: "roboto-700",
    color: "#121212",
    fontSize: 30,
    marginTop: 50,
    marginLeft: 30,
  },
  joinAGame: {
    fontFamily: "roboto-regular",
    color: "#121212",
    marginTop: 2,
    marginLeft: 30,
    marginBottom: 15,
  },
  icon1: {
    color: "rgba(128,128,128,1)",
    fontSize: 30,
    marginTop: 11,
  },
  buyCoupons: {
    fontFamily: "roboto-500",
    color: "#121212",
    marginLeft: 7,
    marginTop: 18,
  },
  containerUser: {
    flexDirection: "row",
    flex: 1,
  },
  group: {
    width: 39,
    height: 47,
    alignSelf: "flex-end",
    marginTop: -5,
    position: "absolute",
  },
  button: {
    width: 39,
    height: 47,
  },
  icon2: {
    color: "rgba(128,128,128,1)",
    fontSize: 30,
    height: 30,
    width: 30,
    marginTop: 12,
    marginLeft: 3,
  },
  icon1Row: {
    height: 47,
    flexDirection: "row",
    marginTop: 50,
    marginLeft: 29,
  },
});

export default Feed;
